import Nav from "./Nav.js";

export default function Footer() {
    return (
        <>
            let lightgray = "#d3d3d3";
            <Nav />
            <h2 style={{ color: lightgray, fontSize: 10 }}>&copy; 2013 Valet Industries, Inc</h2>
        </>
    );
}
